e: both; overflow: auto; cursor: pointer; margin: 0px 0.5em;\"><span style=\"font-size: 12pt; line-height: 18.4px;\">Hi! Im Gemma! Im from Manchester. I get up at seven oclock and breakfast is at half past seven. I dont like cereal but I eat toast and I have a drink. Then, I go to school with my friends. I always wear a uniform at school but when Im not wearing my uniform I usually wear jeans or trousers and a T-shirt.</span></span></p><p style=\"margin: 0px 0px 10px; font-family: sans-serif; color: rgb(51, 51, 51); font-size: 14.44px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\"><span lang=\"EN-GB\" style=\"font-size: 12pt; line-height: 18.4px; font-family: &quot;Bookman Old Style&quot;, serif;\">Lunch is at half past twelve. I have lunch at school. I have sandwiches but my friend Saskia has fish and chips. Chips are my favourite food! School finishes at quarter past four. I eat an apple when I walk home. My friends eat sweets!!&nbsp; After school I go to dance lessons, I like dancing.</span></p><p style=\"margin: 0px 0px 10px; font-family: sans-serif; color: rgb(51, 51, 51); font-size: 14.44px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\"><span lang=\"EN-GB\" style=\"font-size: 12pt; line-height: 18.4px; font-family: &quot;Bookman Old Style&quot;, serif;\">At home, I do my homework, my favourite subject is English! I sometimes tidy my room and I make my bed but I never lay the table. I help my mother to cook dinner. Dinner is at six oclock and I eat it at table with my family. We dont watch TV  we talk about our day at school. We eat lots of different food but pizza is my favourite.</span></p><br></p>',1,'',1,0.0000000,0.0000000,'description',0,'moodle.quatrosoft.com+160803022047+armOLa','moodle.quatrosoft.com+160803022124+zWd91A',0,1470190847,1470190884,2,2),(40,30,0,'Ejercicio2 - a','<p><p style=\"text-indent:-18.0pt\"><!--[if !supportLists]--><b><span lang=\"EN-GB\" style=\"font-family:&quot;Bookman Old Style&quot;,serif\">A)<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;\r\n</span></span></b><!--[endif]--><b><u><span lang=\"EN-GB\" style=\"font-family:&quot;Bookman Old Style&quot;,serif\">Answer the questions.</span></u></b></p><br></p>',1,'',1,1.0000000,0.0000000,'essay',1,'moodle.quatrosoft.com+160803022239+R0lhf5','moodle.quatrosoft.com+160803022239+H9ym5w',0,1470190959,1470190959,2,2),(41,12,0,'Emparejamiento','<p>Emparejamiento</p>',1,'',1,1.0000000,0.3333333,'match',1,'moodle.quatrosoft.com+160804034011+qpwvDh','moodle.quatrosoft.com+160804034011+Ku64Q0',0,1470282011,1470282011,2,2),(42,12,0,'Respuesta corta','<p>Escriba la palabra \"pregunta\"</p>',1,'<p>Retroalimentacin general</p>',1,1.0000000,0.3333333,'shortanswer',1,'moodle.quatrosoft.com+160804034306+uIoEQF','moodle.quatrosoft.com+160804034306+qGZ0LD',0,1470282186,1470282186,2,2),(43,12,0,'a ver','<p><em style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Arial, Tahoma, Verdana; font-size: 13px; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Selecciona la respuesta correcta :&nbsp;<br>2 + 2 = {#1} *&nbsp;<br>El lado opuesto a los catetos en un tringulo rectngulo se llama: {#2} *&nbsp;<br>La herramienta sobre la que trata este curso se llama {#3}&nbsp;<br>El valor de