rong><strong><span style=\"text-decoration: underline;\">Answer the questions.</span></strong></p>\r\n<ol>\r\n<li>What time does Emma get up?<em>{#1}</em></li>\r\n<li>What does Gemma do in the mornings? (mention 3 activities)<em><em>{#2}<em><em>{#3}<em><em>{#4}</em></li>\r\n<li>What items of clothing does Gemma usually wear? <em><em>{#5}<em><em>{#6}<em>{#7}</li>\r\n<li>What does she do after school?{#8}</li>\r\n<li>What activities does she do at home? (mention 3 activities)<em>{#9}</em></li>\r\n<li>Does she like watching TV?<span>{#10}</span></li>\r\n</ol>\r\n<p></p>',1,'',1,12.0000000,0.3333333,'multianswer',1,'moodle.quatrosoft.com+160805023013+pzhLEi','moodle.quatrosoft.com+160806040050+Nte6uO',0,1470364213,1470456050,2,2),(55,12,54,'Pregunta 2','{2:MCH:a.08:00#Retroalimentacin para esta respuesta equivocada~b.07:15#Retroalimentacin para la otra respuesta equivocada~=c.07:00#Retroalimentacin para la respuesta correcta~%50%d.08:15#Retroalimentacin para respuesta con medio puntaje}',1,'',1,2.0000000,0.0000000,'multichoice',1,'moodle.quatrosoft.com+160805023014+B1FDna','moodle.quatrosoft.com+160806040050+MsuUiE',0,1470364214,1470456050,2,2),(56,12,54,'Pregunta 2','{1:SHORTANSWER:fail</em></em><em>#<em>fail!<em>~=go to school#<em>Perfect!<em><em><em>~=get up#<em>Perfect!<em><em><em><em><em><em><em>~=eat#<em>Perfect!</em></em></em></em></em></em></em></em></em></em></em></em></em></em></em></em>}',1,'',1,1.0000000,0.0000000,'shortanswer',1,'moodle.quatrosoft.com+160805023014+R0ePMF','moodle.quatrosoft.com+160806040050+Lp766t',0,1470364214,1470456050,2,2),(57,12,54,'Pregunta 2','{1:SHORTANSWER:fail</em></em><em>#<em>fail!<em>~=go to school#<em>Perfect!<em><em><em>~=get up#<em>Perfect!<em><em><em><em><em><em><em>~=eat#<em>Perfect!</em></em></em></em></em></em></em></em></em></em></em></em></em></em></em>}',1,'',1,1.0000000,0.0000000,'shortanswer',1,'moodle.quatrosoft.com+160805023014+BrCTqv','moodle.quatrosoft.com+160806040050+30hcDD',0,1470364214,1470456050,2,2),(58,12